@felipe_autran Já viramos chacota lá fora. Tem jornal falando que elegemos um idiota.

Pra mim, a que mais me incomodou, foi a primeira dama do Canadá, numa palestra se não me engano, incentivar seus compatriotas a estudarem porque só no Brasil se torna embaixador fritando hambúrguer.

Aí matou

PRECISAMOS DE UMA LEI QUE:
QUANDO UM INDIVÍDUO MORRE OU SE FERE POR ATOS ILÍCITOS, ELE SEJA CONSIDERADO SUICIDA OU CULPADO, DEVENDO ARCAR COM EVENTUAIS PREJUÍZOS .( SAÚDE OU PROCESSO).
